import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <div class="topnav-centered">
        <Link to="/">
        Home
        </Link>
        <Link to="/search">
        Search
        </Link>
        <Link to="/favourite-list">
        Favourite
        </Link>
      </div>
  );
};

export default Nav;
